import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialScreenshot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialScreenshot });
    screenshots.push(initialScreenshot);

    // Wait for the Cart element (using text selector and class)
    const cartSelector = "//div[contains(@class, 'cart') and contains(normalize-space(), 'Cart')]";
    await page.waitForSelector(cartSelector, { timeout: 5000 });

    // Take a screenshot before clicking cart
    const beforeCartClick = path.join(screenshotsDir, 'step_2_before_cart_click.png');
    await page.screenshot({ path: beforeCartClick });
    screenshots.push(beforeCartClick);

    // Click the Cart element (using XPath for robustness)
    const cartElement = await page.$(cartSelector);
    if (!cartElement) throw new Error("Cart element not found");
    await cartElement.click();

    // Wait for the cart modal to appear (wait for .modal-content with h2 "Shopping Cart" or similar)
    // Try multiple strategies for robustness
    let modalContent = null;
    try {
      // Try by heading text
      await page.waitForSelector("//div[contains(@class,'modal-content')]//h2[contains(text(),'Cart') or contains(text(),'Shopping Cart')]", { timeout: 4000 });
      modalContent = await page.$("//div[contains(@class,'modal-content')]//h2[contains(text(),'Cart') or contains(text(),'Shopping Cart')]");
    } catch {
      // Fallback: wait for visible .modal-content
      await page.waitForSelector('.modal-content', { state: 'visible', timeout: 4000 });
      modalContent = await page.$('.modal-content');
    }

    // Take screenshot after modal is open
    const afterModalOpen = path.join(screenshotsDir, 'step_3_cart_modal_open.png');
    await page.screenshot({ path: afterModalOpen });
    screenshots.push(afterModalOpen);

    // Extract modal heading and cart item count if present
    let modalHeading = '';
    let cartItemCount = null;
    if (modalContent) {
      modalHeading = await modalContent.evaluate(el => {
        const h2 = el.querySelector('h2');
        return h2 ? h2.textContent.trim() : '';
      });
      // Try to extract cart item count from modal, fallback to cart icon
      const cartCountElem = await page.$('#cartCount');
      if (cartCountElem) {
        cartItemCount = await cartCountElem.textContent();
        cartItemCount = cartItemCount.trim();
      }
    }

    return {
      success: true,
      action: "Opened the Shopping Cart modal and verified its appearance.",
      extractedData: {
        modalHeading,
        cartItemCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
